types.description:
`HospitalityContract`: An individual property or a group of properties with a single payer signs an enrollment contract with us.

&ZeroWidthSpace;

This is the lowest level in the hierarchy, so payment can't be subdivided any further than this. Whoever is listed as the contact is billed.

`NegotiatedRateContract`: A parent brand signs a contract with us that negotiates a rate and other terms for any of its member or franchisee properties that choose to enroll. The parent can pay, the individual properties can pay, or a combination of both.

&ZeroWidthSpace;

Individual properties (or property groups) who enroll under the terms negotiated by the parent are added to `contracts` as `HospitalityContract` objects.

